import React from 'react';
import {Autocomplete} from '@material-ui/lab'
import {TextField} from '@material-ui/core'

function Header(props) {
  return (
  <div style={{ width: 300 }}>
    <Autocomplete
        freeSolo
        id="free-solo-2-demo"
        disableClearable
        options={['hello','hi'].map(option => option)}
        renderInput={params => (
          <TextField
            {...params}
            label="Search image"
            margin="normal"
            variant="outlined"
            onChange = { (e) => props.setQuery(e.target.value)}
            onInputChange = {(e) => props.setQuery(e.target.value)}
            fullWidth
            InputProps={{ ...params.InputProps, type: 'search' }}
          />
        )}
      />
    <input type="text" value={props.query} onChange={ (e) => props.setQuery(e.target.value)}></input>
  </div>
  );
}

export default Header;
